import React from 'react';

const Title = () => {
  return (
    <div className="title">
      <h1>FotoGrid</h1>
      <h2> Real Time Photobook  </h2>
      <p> Upload some photos to show the world <br></br> that you know how to use internet 👨🏼‍💻 </p>
    </div>
  )
}

export default Title;
